import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Employee from './Employee';

function App() {
  return (
    <BrowserRouter>
    <Switch>
      <Route path="/Employee" exact component={Employee} />
    </Switch>
  </BrowserRouter>
  );
}

export default App;
